import React from "react";

import { Form, Formik } from "formik";
import { initialValues, onSubmit, validationSchema } from "../formikAttribute_auth";
import { FormControl } from "../FormControl_Auth";


export const RegisterInputs = () => {
  const ItemValidationTypeRadio = [
    { id: "phone", name: "phone" },
    { id: "email", name: "email" },
  ];
  return (
    <Formik
      initialValues={initialValues}
      onSubmit={onSubmit}
      validationSchema={validationSchema}
    >
      {(formik) => {
        // console.log(formik);
        // console.log(formik.values.auth_mode);
        return (
          <Form>
            <div className="inputsOfRegister">


              {/* ===== phone input ===== */}


                  <FormControl
                    formik={formik}
                    control="input"
                    type="number"
                    name="phone"
                    placeholder="phone"
                    inputStyle="registerInputStyle"
                  />



              {/* ===== password , confirmation inputs ======= */}
              <div className="d-flex ">
                <FormControl
                  formik={formik}
                  control="input"
                  type="password"
                  name="password"
                  placeholder="password"
                  inputStyle="registerInputStyle"
                  errMsg="divErrMsg"
                />
                <FormControl
                  formik={formik}
                  control="input"
                  type="password"
                  name="confirmPassword"
                  placeholder="confirm password"
                  inputStyle="registerInputStyle"
                />
              </div>





            </div>

            {/* ====== validation type radio button ====== */}
            <div>
              <FormControl
                formik={formik}
                control="validation-type"
                type="radio"
                label="validation type"
                nameOfItem={ItemValidationTypeRadio}
                name="auth_mode"
              />
            </div>
          </Form>
        );
      }}
    </Formik>
  );
};
